import React, { useState, useEffect } from "react";

function Page(pros) {
  const [outro, setOutro] = useState();
  const id = props?.url?.query?.id;
  console.log(props);
  useEffect(() => {
    fetch(`https://jsonplaceholder.typicode.com/posts/${id}`)
      .then((response) => response.json())
      .then((json) => setOutro(json));
  }, [id]);
  console.log(id);
  return (
    <div>
      {outro && (
        <div>
          <p>{outro.id}</p>
          <p>{outro.title}</p>
          <p>{outro.body}</p>
        </div>
      )}
    </div>
  );
}
export default Page;
